(44, 'page', 'research', 'content', 'text', 'text/html', 'da', '<h2><font face="Arial"><span style="font-size: 14px;">VIDENSDELING VIA DIME</span></font></h2><p><font face="Arial"><span style="font-size: 12px;">Gennem vidensdeling bliver vi alle klogere. DIME hylder og søger aktivt at understøtte dette princip, hvorfor vi ikke kun opfordrer detektorbrugerne til at levere deres unikke viden i form af fundindberetninger, men også tilskynder, at forskere her på hjemmesiden offentliggør nye forskningsresultater vedrørende metaldetektorfundene. For at stimulere denne ”delingskultur” bliver alle med forskeradgang til databasen afkrævet et kort resumé af deres arbejde, når de publicerer forskning med afsæt i DIME. Disse resuméer kan i lighed med anden relevant forskning og henvisninger til andre forskningsarbejder findes ved at følgende de forskellige nedenstående links.</span></font></p><p><img style="width: 1013px;" src="data:image/jpeg;base64," data-filename="20150103_110259 a-2.jpg"><font face="Arial"><span style="font-size: 12px;"><br></span></font></p>', 0, NULL, NULL, 0, '2017-05-08 18:25:30', 0, '0000-00-00 00:00:00', '');
